import React from 'react'

const Task = (props) => {
    return (
        <div className='task'>
            <h3>{props.task.text}</h3>   
            <p>{props.task.day}</p>
            <p>{props.task.reminder ? 'Yes' : 'No'}</p>         
        </div>
    )
}

export default Task
